import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import '../App.css';

const Login = () => {
    return(
        <Container className="center">
            <Row>
                <Col>
                    <input placeholder="username"></input>
                </Col>
            </Row>
            <Row>
                <Col>
                    <input placeholder="password"></input>
                </Col>
            </Row>
        </Container>
    )
}

export default Login;
